import { Doughnut } from 'react-chartjs-2'
import styled from 'styled-components'

const Graph = styled.div`
  width: 15rem;
  height: 15rem;
  border-radius: 100%
`

const DoughnutChart = props => (
  <Graph>
    <Doughnut 
      datasets={ [4.89, 12.00] }
    />
  </Graph>
)

export default DoughnutChart
